import { useParams } from "react-router-dom";
function EventDetailPage() {
  const params = useParams();

  return (
    <>
      <h1>EventDetailPage</h1>
      <p>
        eventId: {params.id}
      </p>
    </>
  );
}

export default EventDetailPage;

export async function loader({request,params}){
  console.log(request);
